import React from 'react';

const styles = {
  img: {
  },
};

export default function Home() {
  return (
    <div>
      <h1><img src="/cormillionaireLogo.png" alt="cormillionaire" style={styles.img}></img></h1>
      <p>
      'm Cornelia Herman and in August 2021, I started my journey into web app development. 
      Personally, I enjoy woodworking and creating things in my free time. It pairs well with my degree in Industrial Design from James Madison University. Career wise: I've bounced between data entry, into project management, then business analyst, and now into product management.

So far I've enjoyed learning about how we can manipulate the frontend, getting additional data from different APIs and look forward to continuing to learn more.
      </p>
    </div>
  );
}
